import React from 'react';
import styles from './nav.css';

class Nav extends React.Component {

  render() {
    const btnText = this.props.view === 'new' ? 'View Saved Sessions' : 'Create New Session';
    return(
      <ul className="nav flex-column">
        <li className="nav-item">
          <div className="disabled" style={{ marginBottom: '1em' }} tabindex="-1" aria-disabled="true">Logged In: {this.props.username}</div>
        </li>
        <li className="nav-item">
          <button className="btn btn-primary btn-sm" onClick={this.props.onViewChange}>{btnText}</button>
        </li>
      </ul>
    )
  }

}

export default Nav;
